import { combineReducers, Reducer, AnyAction, Action } from "redux";
import tasksReducer from "../components/tasks/reducer";
import { IApplicationState } from "./types";

const reducers: Reducer<IApplicationState,Action> = combineReducers<IApplicationState>(
  {
    tasks: tasksReducer
  }
);

export default reducers;
